    "narrative-report-fort-niobrara-national-wildlife-refuge-june-16-1941-july-31-1941",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from June through July
    of 1941. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    and collections and receipts. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses
    and Refuge visitors. Photographs are attached.",nt"license_title": "License
